import React from 'react'
function Login() {
  return (
    <div className='min-h-screen bg-green-300 flex items-center justify-center'>
        <div className='bg-white w-[350px] p-6 rounded-lg shadow-md'> /* login-container */
            <h1 className='text-center text-2xl text-green-700 mb-5'>Login </h1>
            <form>

         <div className='mb-4'> /*input-group*/
                <label className='block text-sm mb-1'>Email</label>
                <input type='email' placeholder='Enter email'required
                className='w-full px-3 py-2 border border-gray-300 rounded fo'/>
                </div>


                <div className='items-center'> /*input-group*/
                <label>Password</label>
                <input type='password' placeholder="Enter password" required/>
                </div>

                <button type='submit'>Login</button>
            <p className='text-center text-sm-mt-4'> 
                Don't have an account? 
                <a href='#' className='text-green-600 hover:underline'>Register</a>
            </p>
            </form>
        </div></div>)}export default Login
